    private function transformWithCityAndRegion($brgyArray)
    {
        $currRegion = [];
        $currCity = [];
        $arr = [];
        foreach ($brgyArray as $brgy) {
            $region = $brgy['region_name'];
            $city = $brgy['city_name'];

            if ($currRegion != $region) {
                $currRegion = $region;
                $arr[$currRegion] = [];
            }

            if ($currCity != $city) {
                $currCity = $city;
                $arr[$currRegion][$currCity] = [];
            }
        }
    }

    /**
     * Run the database seeds.
     *
     * @return void
     */
    public function run()
    {
        $brgyArr = collect(array_map(function($brgy) {
            $city = $this->cityRepository->getByColumnWith('name', $brgy['city_name'], [
                'region' => function (BelongsTo $query) use($brgy) {
                    $query->where('name', $brgy['region_name']);
                }
            ]);

            return [
                'city_municipality_id' => $city['id'],
                'name' => strtoupper($brgy['barangay'])
            ];
        }, $this->barangays));

        $arrayChunk = $brgyArr->chunk(1000);

        foreach($arrayChunk as $chunk) {
            $this->barangayRepository->createAll($chunk->toArray());
        }
    }
